	function renderTextWithLineSpacing(pdf, text, x, y, maxWidth, lineHeightMultiplier, fontSize) {
		const lines = pdf.splitTextToSize(text, maxWidth);
		const actualLineHeight = fontSize * lineHeightMultiplier;
		lines.forEach(line => {
			pdf.text(line, x, y);
			y += actualLineHeight;
		});
		return y;
	}

